import React from 'react';
import { Icon, PlusGrid, PlusGridItem } from 'components';
import Link from 'next/link';
import * as Constants from '../../../constants';

export const Socials = () => {
  return (
    <PlusGrid alignItems="center" gutter="md" justify="center">
      <PlusGridItem>
        <Link href={Constants.SOCIAL_TWITTER}>
          <Icon name="twitter" />
        </Link>
      </PlusGridItem>
      <PlusGridItem>
        <Link href={Constants.SOCIAL_INSTAGRAM}>
          <Icon name="instagram" />
        </Link>
      </PlusGridItem>
      <PlusGridItem>
        <Link href={Constants.SOCIAL_GITHUB}>
          <Icon name="github" />
        </Link>
      </PlusGridItem>
      <PlusGridItem>
        <Link href={Constants.SOCIAL_LINKEDIN}>
          <Icon name="linkedin" />
        </Link>
      </PlusGridItem>
    </PlusGrid>
  );
};
